import React, { useEffect, useState } from "react"


const Button = (props) => {
    const [click, setClick] = useState(3)

    useEffect(() => {
        document.title = `TAB ${click}`
    })   

    return (
        <button className='button' onClick={ () => setClick(click - 1)}>{props.text} {click}</button>
    )
}

Button.defaultProps = {
    text: 'Кнопка'
}

export default Button
